import React from 'react';
import SearchBar from './SearchBar';

class App extends React.Component {
  state = { video: [] };

  onTermSubmit = (term) => {
    console.log(term);
  }

  render() {
    return (
      <div className="ui container" style={{ marginTop: '10px' }}>
        <SearchBar onTermSubmit={this.onTermSubmit}/>
      </div>
    )
  };
};

export default App;
